import { useEffect, useRef } from "react";

function SantaCanvas() {
  const canvasRef = useRef(null);

  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext("2d");

    canvas.style.width = "400px";
    canvas.style.height = "400px";
    canvas.width = 400;
    canvas.height = 400;

    let mouse = {
      x: null,
      y: null,
      radius: 20,
    };

    const randomImgOption = Math.trunc(Math.random() * 2);
    const img = new Image();
    img.src = santaBase64Data(randomImgOption); // ðŸ’¡ Define this function!

    const scale = 1.5;
    const particles = [];

    img.onload = () => {
      ctx.drawImage(img, 0, 0, img.width * scale, img.height * scale);

      const data = ctx.getImageData(0, 0, canvas.width, canvas.height);
      ctx.clearRect(0, 0, canvas.width, canvas.height);

      let stagger = 2;

      for (let y = 0; y < data.width; y += stagger) {
        for (let x = 0; x < data.height; x += stagger) {
          const p = (x + y * data.width) * 4;
          if (data.data[p + 3] > 129) {
            particles.push({
              xCurrent: x,
              yCurrent: y,
              xStart: x,
              yStart: y,
              speed: Math.random() * 4 + 2,
              color: `rgb(${data.data[p]}, ${data.data[p + 1]}, ${
                data.data[p + 2]
              })`,
              density: Math.random() * 100,
            });
          }
        }
      }
      render();
    };

    const render = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      for (let i = 0; i < particles.length; i++) {
        const particle = particles[i];
        ctx.fillStyle = particle.color;
        ctx.fillRect(particle.xCurrent, particle.yCurrent, 2, 2);

        const dx = particle.xCurrent - mouse.x;
        const dy = particle.yCurrent - mouse.y;
        const distance = Math.sqrt(dx * dx + dy * dy);
        const forceDirectionX = dx / distance;
        const forceDirectionY = dy / distance;
        const force = (mouse.radius - distance) / mouse.radius;
        const directionX = forceDirectionX * force * particle.density;
        const directionY = forceDirectionY * force * particle.density;

        if (distance < mouse.radius) {
          particle.xCurrent += directionX;
          particle.yCurrent += directionY;
        } else {
          if (particle.xCurrent !== particle.xStart) {
            let dx = particle.xCurrent - particle.xStart;
            particle.xCurrent -= dx / 20;
          }
          if (particle.yCurrent !== particle.yStart) {
            let dy = particle.yCurrent - particle.yStart;
            particle.yCurrent -= dy / 20;
          }
        }
      }
      requestAnimationFrame(render);
    };

    const handleMouseMove = (e) => {
      const rect = canvas.getBoundingClientRect();
      mouse.x = e.clientX - rect.left;
      mouse.y = e.clientY - rect.top;
    };

    window.addEventListener("mousemove", handleMouseMove);

    return () => {
      window.removeEventListener("mousemove", handleMouseMove);
    };
  }, []);

  return <canvas id="merry-christmas" ref={canvasRef}></canvas>;
}

export default SantaCanvas;

function santaBase64Data(option) {
  if (option === 0) {
    return `data:image/png;base64,`;
  } else if (option === 1) {
    return ` data:image/png;base64,`;
  }
}
